// import About from '../pages/About.page'

import { JSX } from "react"

export interface NavBarItem {
    path: string
    label: string
    unavailable?: boolean
    active?: boolean
    new?: boolean
    subItems?: NavBarItem[]
    component?: () => JSX.Element
}

export const NAV_BAR_ITEMS: NavBarItem[] = [
    // { path: /about, label: 'About', component: About},
]
